import React from "react"; 
import { Star } from "./star";

type RatingType = {
  value: number;
};

export const Raiting = (props: RatingType) => {

  return (
    <>
      <Star selected={false} />
      <Star selected={false} />
      <Star selected={false} />
      <Star selected={false} />
      <Star selected={false} />
    </>
  )

  switch (props.value) {
    case 0:
      return (
        <>
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
        </>
      );
    case 1:
      return (
        <>
          <Star selected={true} />
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
        </>
      );
    case 2:
      return (
        <>
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={false} />
          <Star selected={false} />
          <Star selected={false} />
        </>
      );
    case 3:
      return (
        <>
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={false} />
          <Star selected={false} />
        </>
      );
    case 4:
      return (
        <>
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={false} />
        </>
      );
    default:
      return (
        <>
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
          <Star selected={true} />
        </>
    );
  }
};
